import React from 'react';

function User({user}){
    return(
        <div>
            <b>{user.username}</b><span>({user.email})</span>
        </div>
    );
};






function UserList () {

    const users = [
        {
            id : '1'
            , username : '남윤재'
            , email : 'nyj9349@hanmail.net'
        },
        {
            id : '2'
            , username : '벨로퍼트'
            , email : 'velopert@gmail.com'
        },
        {
            id : '3'
            , username : '홍길동'
            , email : 'hong@gmail.com'
        }
    ];


    return (
        <>
            <div>
                <span>이름 : {users[0].username}</span> / 
                <span>이메일 : {users[0].email}</span>
            </div>
            <div>
                <span>이름 : {users[1].username}</span> / 
                <span>이메일 : {users[1].email}</span>
            </div>
            <div>
                <span>이름 : {users[2].username}</span> / 
                <span>이메일 : {users[2].email}</span>
            </div>
        </>
    );
};  

export default UserList;
